import React from 'react';
import './Home.css';
import yourImage from './path-to-your-image.jpg'; 
function HomePage() {
  return (
    <div className="home">
      <h1>Welcome to DevsOnDeck</h1>
      <p>Your platform for connecting with talented developers or finding the perfect job opportunity.</p>
      <button className="home-button">Get Started</button>
      <div className="image-container">
        <img src={yourImage} alt="Descriptive Alt Text" className="home-image" />
      </div>
    </div>
  );
}

export default HomePage;
